import React from 'react';

const List = ({ people }) => {
  return (
    <>
      {people.map((...person) => {
        return (
          <article key={id} className='person'>
            <img src={image} alt={person.name} />
            <div>
              <h4>{person.name}</h4>
              <p>{age} years</p>
            </div>
          </article>
        );
      })}
    </>
  );
};

export default List;
